import React from 'react';
import Post from './Post'

const Posts = (posts) => {
    return (
        <div>
            {posts.array.forEach(post => {
                <Post 
                text = {post.text}
                likes = {post.likes}
                creationDateTime = {post.creationDateTime}
                id = {post.id}

            />
            })};
        </div>
    )
}

export default Posts;
